Этот каталог является кэшем реализации. Файлы в нем доступны только для чтения с использованием прав доступа файловой системы. Это не позволяет удалять их обычным способом.

Если необходимо удалить одну реализацию, можно воспользоваться этой командной строкой:
{0}

Если необходимо удалить весь каталог, то можно воспользоваться этой командой:
{1}

Если необходимо удалить весь каталог без использования Zero Install, можно воспользоваться этой командной строкой:
{2}
